class Model{constructor(t,s){this.compartments=t,this.key=s}get_data(t){key=this.key;for(var s=0;s<t;s++){var e;for(e in this.compartments)key[this.compartments[e][1]]=this.compartments[e][0].get_data(key);if(s==t-1){var r={};for(e in this.compartments)r[this.compartments[e][1]]=key[this.compartments[e][1]];return r}}}}
